(18, 1, 'about', 'about_hero_heading', 'About {business_name}', 'heading', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
(19, 1, 'about', 'about_hero_description', 'Where modern meets the masterpiece. We curate contemporary artworks that transform spaces and inspire minds, bringing the finest artistic expressions to your home and office.', 'paragraph', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
(20, 1, 'about', 'about_mission_badge', 'Our Mission', 'badge', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
