(22, 1, 'about', 'about_mission_para_1', 'At {business_name}, we believe that art has the power to transform spaces and elevate human experiences. Our mission is to make premium contemporary art accessible to everyone, connecting artists with art lovers and creating beautiful, meaningful spaces.', 'paragraph', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
(23, 1, 'about', 'about_mission_para_2', 'We carefully curate each piece in our collection, ensuring that every artwork tells a story and brings unique energy to your environment. From vibrant abstract expressions to serene landscapes, devotional art to modern masterpieces, we offer something for every taste and space.', 'paragraph', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
(24, 1, 'about', 'about_values_badge', 'Our Values', 'badge', '2025-11-29 12:02:23', '2025-11-29 12:02:23'),
